parts:
[
  {
    "class_id": "0x06",
    "message_id": "0x8b",
    "name": "UBX-CFG-VALGET",
    "description": "Poll request to get configuration items by providing a list of configuration key IDs.",
    "message_type": "get",
    "payload_length": {
      "variable": {
        "base": 4,
        "formula": "4 + num_keys * 4"
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "version",
        "description": "Message version (0x00 for this version)",
        "fixed_value": 0
      },
      {
        "byte_offset": 1,
        "data_type": "U1",
        "name": "layer",
        "description": "The layer from which the configuration items should be retrieved: 0 - RAM layer, 1 - BBR layer, 2 - Flash layer, 7- Default layer"
      },
      {
        "byte_offset": 2,
        "data_type": "U2",
        "name": "position",
        "description": "Skip this many key values before constructing output message"
      },
      {
        "byte_offset": 4,
        "data_type": {
          "array_of": "U4",
          "count": "variable"
        },
        "name": "keys",
        "description": "Configuration key IDs of the configuration items to be retrieved"
      }
    ]
  },
  {
    "class_id": "0x06",
    "message_id": "0x8b",
    "name": "UBX-CFG-VALGET",
    "description": "Polled response message output by the receiver to return requested configuration data (key and value pairs).",
    "message_type": "polled",
    "payload_length": {
      "variable": {
        "base": 4,
        "formula": "4 + cfgData_length"
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "version",
        "description": "Message version (0x01 for this version)",
        "fixed_value": 1
      },
      {
        "byte_offset": 1,
        "data_type": "U1",
        "name": "layer",
        "description": "The layer from which the configuration item was retrieved: 0 - RAM layer, 1 - BBR, 2 - Flash, 7 - Default"
      },
      {
        "byte_offset": 2,
        "data_type": "U2",
        "name": "position",
        "description": "Number of configuration items skipped in the result set before constructing this message (mirrors the equivalent field in the request message)"
      },
      {
        "byte_offset": 4,
        "data_type": {
          "array_of": "U1",
          "count": "variable"
        },
        "name": "cfgData",
        "description": "Configuration data (key and value pairs)"
      }
    ]
  }
]
